INSERT INTO `media` (`id`, `reference`, `description`, `type`, `genre`, `keywords`, `disponibility`, `title`, `picture`) VALUES
(1, '9782253071167', 'Justine, vingt et un ans, vit chez ses grands-parents avec son cousin Jules depuis la mort de leurs parents respectifs dans un accident. Justine est aide-soignante aux Hortensias, une maison de retraite, et aime par-dessus tout les personnes âgées. Notamment Hélène, centenaire, qui a toujours rêvé d\'apprendre à lire. Les deux femmes se lient d\'amitié, s\'écoutent, se révèlent l\'une à l\'autre. Grâce à la résidente, Justine va peu à peu affronter les secrets de sa propre histoire. Un jour, un mystérieux « corbeau » sème le trouble dans la maison de retraite et fait une terrible révélation.\r\nÀ la fois drôle et mélancolique, un roman d\'amours passées, présentes, inavouées... éblouissantes.', 'Livre', 'Littérature française', 'Hachette Poche', 2, 'Les oubliés du dimanche', );
INSERT INTO `media` (`id`, `reference`, `description`, `type`, `genre`, `keywords`, `disponibility`, `title`, `picture`) VALUES
(2, '9782253117186', 'Souvent les enfants sinventent une famille. une autre origine. dautres parentsLe narrateur de ce livre. lui. sest invent un frre Un frrean. plus beau. plus fort. quil voque devant. les copains devacances. les trangers. ceux qui ne vrifieront pas ... Et puis unjour. il dcouvre la vrit. impressionnante. terrifiante presque.Et cest alors toute une histoire familiale. lourde. complexe. quil lui incombe de reconstituer. Une histoire tragique qui leramne aux temps de lHolocauste. et des millions de disparus surqui sest abattue une chape de silencePsychanalyste. Philippe Grimbert est venu au roman avec La PetiteRobe de Paul. Avec ce nouveau livre. couronn en 2004 par le prixGoncourt des lycens et en 2005 par le Grand Prix littraire deslectrices de Elle. il dmontre avec autant de rigueur que dmotioncombien les puissances', 'Livre', 'Littérature française', 'Hachette Poche Philippe Grimbert', 2, 'Un secret', );
INSERT INTO `media` (`id`, `reference`, `description`, `type`, `genre`, `keywords`, `disponibility`, `title`, `picture`) VALUES
(3, ' 9782266093088', 'Venise, cité sinueuse, est un labyrinthe imprévisible.\r\nEt Catherine Parrish, jeune New-Yorkaise angoissée par son mariage imminent, entend bien s\'y perdre. Au prétexte d\'une thèse en histoire de l\'art, la voilà débarquée dans la Sérénissime, goûtant chaque ruelle, chaque canal, chaque campo reculé avec émerveillement. La découverte d\'une synagogue secrète et oubliée, ainsi que la rencontre de Marco, gondolier tourmenté, vont l\'initier aux arcanes de la ville jaillie de la mer, la forçant à sortir des sentiers touristiques et rebattus.\r\nAinsi que des routes trop balisées de sa propre existence...', 'Livre', 'Romans et littérature', 'Poche Presses Pocket', 1, 'La chambre des officiers', );
INSERT INTO `media` (`id`, `reference`, `description`, `type`, `genre`, `keywords`, `disponibility`, `title`, `picture`) VALUES
(4, '9782253140870', 'L\'écume des jours : ce titre léger et lumineux annonce une histoire d\'amour drôle ou grinçante, tendre ou grave, fascinante et inoubliable, composée par un écrivain de vingt-six ans.C\'est un conte de l\'époque du jazz et de la science-fiction, à la fois comique et poignant, heureux et tragique, merveilleux et fantastique, féerique et déchirant. Dans cette oeuvre d\'une modernité insolente, l\'une des plus célèbres du xxe siècle et livre culte depuis plus de cinquante ans, Duke Ellington croise le dessin animé, Sartre devient une marionnette burlesque, la mort prend la forme d\'un nénuphar, le cauchemar va jusqu\'au bout du désespoir.Mais seules deux choses demeurent éternelles et triomphantes : le bonheur ineffable de l\'amour absolu et la musique des Noirs américains? ', 'Livre', 'Littérature française', 'Poche Hachette français 2002-06-05 Boris Vian', 1, 'L\'Écume des jours', );
